# DB BIBLIOTECA

# BANDO DE DADOS E USO
CREATE DATABASE db_biblioteca;
USE db_biblioteca;


# CRIAÇÃO DAS TABELAS
CREATE TABLE Usuario (
  id int NOT NULL,
  matricula varchar(50),
  senha varchar(50),
  nome varchar(50),
  cpf varchar(50),
  telefone varchar(50),
  data_nascimento varchar(50),
  end_cep varchar(50),
  end_logradouro varchar(50),
  end_numero int,
  end_complemento varchar(50),
  end_bairro varchar(50),
  end_cidade varchar(50),
  end_uf varchar(50),
  CONSTRAINT pk_usuario PRIMARY KEY (id)
) ENGINE = InnoDB;

CREATE TABLE Obra (
  id int NOT NULL,
  titulo varchar(150),
  ano int,
  tipo varchar(50),
  assunto varchar(50),
  quantidade_exemplares int,
  preco_exemplar decimal(12,2),
  nome_editora varchar(50),
  cidade_editora varchar(50),
  nomes_autor varchar(50),
  CONSTRAINT pk_obra PRIMARY KEY (id)
) ENGINE = InnoDB CHARSET = UTF8 COLLATE = utf8_general_ci;

CREATE TABLE Reserva (
  id int NOT NULL,
  data_reserva date,
  horario_reserva time,
  data_retirada date,
  id_usuario int NOT NULL,
  id_obra int NOT NULL,
  CONSTRAINT pk_reserva PRIMARY KEY (id),
  CONSTRAINT fk_reserva_usuario FOREIGN KEY (id_usuario)
    REFERENCES Usuario (id),
  CONSTRAINT fk_reserva_obra FOREIGN KEY (id_obra)
    REFERENCES Obra (id)
) ENGINE = InnoDB;

CREATE TABLE Funcionario (
  id int NOT NULL,
  matricula varchar(50),
  senha varchar(50),
  nome varchar(50),
  cargo varchar(50),
  CONSTRAINT pk_funcionario PRIMARY KEY (id)
) ENGINE = InnoDB;

CREATE TABLE Emprestimo (
  id int NOT NULL,
  data_emprestimo date,
  horario_emprestimo time,
  data_retorno date,
  id_usuario int NOT NULL,
  id_obra int NOT NULL,
  id_funcionario int NOT NULL,
  CONSTRAINT pk_emprestimo PRIMARY KEY (id),
  CONSTRAINT fk_emprestimo_usuario FOREIGN KEY (id_usuario)
    REFERENCES Usuario (id),
  CONSTRAINT fk_emprestimo_obra FOREIGN KEY (id_obra)
    REFERENCES Obra (id),
  CONSTRAINT fk_emprestimo_funcionario FOREIGN KEY (id_funcionario)
    REFERENCES Funcionario (id)
) ENGINE = InnoDB;

CREATE TABLE Devolucao (
  id_emprestimo int NOT NULL,
  data_devolucao date,
  horario_devolucao time,
  id_funcionario int,
  CONSTRAINT pk_devolucao PRIMARY KEY (id_emprestimo),
  CONSTRAINT fk_devolucao_emprestimo FOREIGN KEY (id_emprestimo)
    REFERENCES Emprestimo (id),
  CONSTRAINT fk_devolucao_funcionario FOREIGN KEY (id_funcionario)
    REFERENCES Funcionario (id)
) ENGINE = InnoDB;

