# POVOANDO TABELA EMPRESTIMO


UPDATE Emprestimo SET data_retorno = DATE_ADD(data_emprestimo, INTERVAL 7 DAY);

# POVOANDO TABELA DEVOLUÇÃO


UPDATE Devolucao dev SET dev.data_devolucao =
  (SELECT emp.data_emprestimo FROM Emprestimo emp
    WHERE dev.id_emprestimo = emp.id),
  dev.horario_devolucao =
  (SELECT DATE_ADD(emp.horario_emprestimo, INTERVAL 1 HOUR) FROM Emprestimo emp
    WHERE dev.id_emprestimo = emp.id);